details:
The overall goal of Head Start is to bring about a greater degree of social competence in the young children of low-income families.  Social competence is defined as the child’s everyday responsibilities in school and life.  Social competence takes into account the interrelatedness of cognitive and intellectual development, physical and mental health, nutritional needs, and other factors that enable a comprehensive approach to helping children achieve social competence.  The Head Start program approach is based on the philosophy that:
     A child can benefit most from a comprehensive, interdisciplinary program to foster development and remedy problems expressed in a broad range of services and;
    The child’s entire family, as well as the community must be involved.  The program should maximize the strengths and unique experiences of each child.  The family, which is the principal influence on the child’s development, must be a direct participant in the program.

